import React, { createContext, useState } from "react";
import "./App.css";
import Navigation from "./Navigation/Navigation";
import MainHeader from "./MainHeader/MainHeader";
import AboutMe from "./AboutMe/AboutMe";
import Portfolio from "./Portfolio/Portfolio";
import SkillsTechnologies from "./SkillsTechnologies/SkillsTechnologies";
import ContactForm from "./ContactForm/ContactForm";
// Create Context
export const AppContext = createContext({
  show: false,
  setShow: () => {},
  currentPage: "AboutMe",
  setCurrentPage: () => {},
});

// In your App component
function App() {
  const [show, setShow] = useState(false);
  const [currentPage, setCurrentPage] = useState("AboutMe");

  // Providing context values
  return (
    <AppContext.Provider value={{ show, setShow, currentPage, setCurrentPage }}>
      <div className="App">
        <Navigation />
        {AppContext.currentPage === "AboutMe" && <AboutMe />}
        {AppContext.currentPage === "Portfolio" && <Portfolio />}
        {AppContext.currentPage === "SkillsTechnologies" && (
          <SkillsTechnologies />
        )}
        {currentPage === "ContactForm" && <ContactForm />}
      </div>
    </AppContext.Provider>
  );
}

export default App;

